sys_variable_value.value:
(function execute(inputs, outputs) {

  outputs.duration = GlideDateTime.subtract(inputs.actual_end, inputs.actual_start)

  actual_start = new GlideDateTime(inputs.actual_start.toString()).getNumericValue()
  actual_end = new GlideDateTime(inputs.actual_end.toString()).getNumericValue()

  ms = actual_end - actual_start

  gs.info("ms: " + ms)

  outputs.duration = ms



})(inputs, outputs);

